import React from "react";
import ProductSimilarTemizlik from "../Components/product/ProductSimilarTemizlik";
import TemizlikKolonya from "../Components/product/TemizlikKolonya";

function TemizlikKolonyaPage() {
  return (
    <>
      <TemizlikKolonya />
      <ProductSimilarTemizlik />
    </>
  );
}

export default TemizlikKolonyaPage;
